import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
function App() {



  return (
    <div className="App">
       <div class="row">
      <div class="col">

        <table class="table table-dark">
          <thead>
            <tr>
              <p></p>
              <th scope="col">EMPRESA COM MAIS CHAMADOS</th>
              <th scope="col">TOTAL DE PRODUTOS</th>

            </tr>
          </thead>

          <tbody>
            <tr>

              <td>Accenture</td>
              <td>39.962</td>

            </tr>

          </tbody>

        </table>

      </div>
    </div>

    </div>
  );
}

export default App;
